import styled from 'styled-components'

interface Props {
    key: number,
    BoxContent: { 
        photo: string
    }
}

const GridBox: React.FC<Props> = ({BoxContent}) => {

        const BoxContainer = styled.li`
            background-image: ${props => BoxContent.photo};
            width: 30%;
            height: 100px;
        `

        return (
            <BoxContainer>
            </BoxContainer>
        );


}


export default GridBox;
